import React from 'react';
import '../../styles/Healer.css';
import {HEALER_PATH} from "../../constants/routes";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import {Image} from "react-bootstrap";

class Healer extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            npcData: {},
        }
    }

    componentDidMount() {
        this.props.sendGetRequest(HEALER_PATH)
            .then((response) => {
                this.setState({npcData: response['data']});
            }).catch((error) => {
                console.log(error.response);
        })
    }

    render() {
        return (
            <React.Fragment>
                <Row>
                    <Col>
                        <Image
                            src={this.state.npcData['img_path']}
                        />
                    </Col>
                </Row>
            </React.Fragment>
        );
    }
}

export default Healer;
